function BotMessage(text){
    var message = `<div class="BotMessage">
        <div>
            <svg class="BotImage" width="36" height="47" viewBox="0 0 36 47" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                <rect x="1.45679" width="33.6551" height="45.6569" transform="rotate(1.82853 1.45679 0)" fill="url(#pattern0)"></rect>
                <defs>
                <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                <use xlink:href="#image0_90_20" transform="scale(0.000331345 0.000244245)"></use>
                </pattern>
                <image id="image0_90_20" width="3018" height="4096" xlink:href="data:image/png;base64,"></image>
                </defs>
            </svg>
            </div>
        <p>${text}</p>
        </div><br>`;
    document.querySelector(".convo").innerHTML += message;
    document.querySelector(".convo").scrollTo(0, document.querySelector(".convo").scrollHeight);
    document.querySelector("#prompt").classList.remove('disabled')
}
function UserMessage(text){
    var message = `<div class="UserMessage">
                    <img src="assets/gdg.jpeg">
                    <p>${text}</p>
                </div>`;
    document.querySelector(".convo").innerHTML += message;
    document.querySelector(".convo").scrollTo(0, document.querySelector(".convo").scrollHeight);
}
function UserImage(src){
    var message = `<div class="UserImage">
                    <img src="assets/gdg.jpeg">
                    <p><img src="${src}"></p>
                </div>`;
    document.querySelector(".convo").innerHTML += message;
    document.querySelector(".convo").scrollTo(0, document.querySelector(".convo").scrollHeight);
}
function reply(){
    UserMessage(document.querySelector("#prompt").value)
    AiAnswer(document.querySelector("#prompt").value)
    document.querySelector("#prompt").value = ""
    document.querySelector("#prompt").classList.add('disabled')
    BotMessage("Thinking...");
    if(!document.querySelector(".mainChat")){}else{
        document.querySelector(".mainChat").remove()}
    }
