window.onload = function(){
    const textDisplay = document.querySelector('#TypewritingEffect')
    const phrases = ['How is Palestine?', 'Give me the latest informations available about the Israel-Hamas conflict', 'What happened in 7th October 2023?', 'How did the conflict between palestine & israel started?']
    let i = 0
    let j = 0 
    let currentPhrase = []
    let isDeleting = false
    let isEnd = false
    function loop () {
    isEnd = false
    textDisplay.innerHTML = currentPhrase.join('')
    if (i < phrases.length) {
        if (!isDeleting && j <= phrases[i].length) {
        currentPhrase.push(phrases[i][j])
        j++
        textDisplay.innerHTML = currentPhrase.join('')
        }
        if(isDeleting && j <= phrases[i].length) {
        currentPhrase.pop(phrases[i][j])
        j--
        textDisplay.innerHTML = currentPhrase.join('')
        }
        if (j == phrases[i].length) {
        isEnd = true
        isDeleting = true
        }
        if (isDeleting && j === 0) {
        currentPhrase = []
        isDeleting = false
        i++
        if (i === phrases.length) {
            i = 0
        }
        }
    }
    setTimeout(loop, 200)
    }
loop()
document.querySelector("#sendPrompt").onclick = function(){
    reply()
}
document.addEventListener('keypress', (event) => {
  if (event.key === 'Enter' || event.keyCode === 13) {
    reply();
  }
});
}